import React from 'react';

import AddNewTag from './AddNewTag';
const TagsManager = ({ onTitleChange, tagTitle, tags, onNewTag }) => {
	return (
		<>
			<AddNewTag
				onNewTag={onNewTag}
				onTitle={onTitleChange}
				tagTitle={tagTitle}
			/>

			<br />

			<div className={classes.selectedTextArea}>
				{/* {state.dataIsLoading && <Loading />} */}

				{tags.length > 0 ? (
					tags.map((obj, i) => (
						<Tag
							key={obj.id}
							title={obj.title}
							id={obj.id}
							status={obj.status}
							onClick={(item) => {
								dispatch({
									type: ACTIONS.TOGGLE_SELECT,
									payload: { data: item },
								});
							}}
						/>
					))
				) : (
					<div></div>
				)}
			</div>
		</>
	);
};

export default TagsManager;
